import React from "react";
import {BrowserRouter} from "react-router-dom";
import Contact from "./components/Contact/ContactSection";
import CssBaseline from "@material-ui/core/CssBaseline";
import "./App.css";

function App() {
  return (
    <div className="App">
      <React.Fragment>
        <BrowserRouter />
        <Navbar />
        <CssBaseline />
        <Contact />
      </React.Fragment>
    </div>
  );
}

export default App;
